import "./Rt.css";
import axios from "axios"
import { useState, useEffect } from 'react'

const Rt = () => {

  const fetchData = async () => {
    try {
      const requests = [
        axios.get('http://localhost:8080/api/rt/meToOtherRtlist', {
          withCredentials: true,
          headers: { 'X-CSRF-TOKEN': csrfToken },
        }),
        axios.get('http://localhost:8080/api/rt/OtherToMeRtlist', {
          withCredentials: true,
          headers: { 'X-CSRF-TOKEN': csrfToken },
        }),
        axios.get('http://localhost:8080/api/rt/store', {
          withCredentials: true,
          headers: { 'X-CSRF-TOKEN': csrfToken },
        }),
      ];

      const [myRtResponse, otherRtResponse, storeListResponse] = await axios.all(requests);

      setMyRtData(myRtResponse.data);
      setOtherRtData(otherRtResponse.data);
      setStoreList(storeListResponse.data);
    } catch (error) {
      if (error.response && error.response.status === 302) {
        console.error('리다이렉션 발생:', error.response.headers.location);
      } else {
        console.error('Error:', error);
      }
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

    console.log(storeList)

  return(

    <div className="rtPage">
      <h1>매장 RT 관리 </h1>
      <hr />
      <div className="mainContent">

        <div className="searchBar">
          <div className="date">
            <label className="name">지시기간</label>
            <input id="input_date" type="date" />
          </div>

          <div className="checkbox">
            <label className="name">처리구분</label>
            <span className="fristCheckbox">
              <label>미확정</label>
              <input type="radio" />
            </span>
            <span>
              <label>확정</label>
              <input type="radio" />
            </span>
            <span>
              <label>불이행</label>
              <input type="radio" />
            </span>
          </div>

          <div className="selector">
            <label className="name">매장</label> 
            <select>
              <option>매장 선택</option>
              <option>부산 서면점</option>
              <option>수원점</option>
              <option>강남점</option>
              <option>대전점</option>


            </select>
          </div>

          <div className="buttons">
            <button id="searchButton">조회</button>
            <button id="createButton">등록</button>
          </div>
        </div>

        <div className="searchTable">
          <div className="tableName">
            <h3>지시요청 조회</h3>  
          </div>
          <table>
            <thead>
              <tr>
                <th>품번</th>
                <th>품명</th>
                <th>색상</th>
                <th>사이즈</th>
                <th>지시매장</th>
                <th>지시수량</th>
                <th>RT 지시일</th>
                <th>상태</th>
              </tr>
            </thead>
             {myRtData.length > 0 ? (
                  <tbody>
                    {myRtData.map((item, index) => {
                      return (
                        <tr key={item.rt_id}>
                          <td>{item.product_code}</td>
                          <td>{item.product_name}</td>
                          <td>{item.color_code}</td>
                          <td>{item.product_size}</td>
                          <td>{item.request_store}</td>
                          <td>{item.rt_products[0].request_quantity}</td>
                          <td>{item.request_date}</td>
                          <td>{item.rt_status}</td>
                        </tr>
                      )
                    })}
                  </tbody>
            ): ( 
              <tbody>
              데이터가 없습니다
              </tbody>
              )
            }

          </table>
        </div>
        <div className="searchTable">
          <div className="tableName">
            <h3>타매장 지시요청</h3>  
          </div>
          <table>
            <thead>
              <tr>
                <th>품번</th>
                <th>품명</th>
                <th>색상</th>
                <th>사이즈</th>
                <th>지시매장</th>
                <th>지시수량</th>
                <th>RT 지시일</th>
              </tr>

            </thead>

            {otherRtData.length > 0 ? (
                  <tbody>
                    {otherRtData.map((item, index) => {
                      return (
                        <tr key={item.rt_id}>
                          <td>{item.product_code}</td>
                          <td>{item.product_name}</td>
                          <td>{item.color_code}</td>
                          <td>{item.product_size}</td>
                          <td>{item.request_store}</td>
                          <td>{item.rt_products[0].request_quantity}</td>
                          <td>{item.request_date}</td>
                        </tr>
                      )
                    })}
                  </tbody>
            ): ( 
              <tbody>
              데이터가 없습니다
              </tbody>
              )
            }

          </table>
        </div>
      </div> 

    </div>
